INSERT INTO `subject` VALUES (2,'วิธีปฐมพยาบาล','1. ถ้าแมลงเข้าหู ให้หยอดด้วยน้ำมันมะกอก
INSERT INTO `subject` VALUES (3,'วิธีปฐมพยาบาล','1. กรณีที่ผู้ป่วยยังไม่หมดสติ ใช้วิธีการรัดกระตุกที่ท้องเหนือสะดือ ใต้ลิ้นปี่ในทิศทางเฉียงขึ้น โดยให้ผู้ทำการช่วยเหลือเข้าไปข้างหลังผู้ป่วยที่กำลังยืนอยู่ มือซ้ายกำหมัดไว้ตรงหน้าท้องระหว่างสะดือกับลิ้นปี่ของผู้ป่วย มือขวากำรอบกำปั้นซ้ายหรือใช้วิธีประสานมือ 2 ข้างเข้าด้วยกัน แล้วรัดกระตุกเข้าหาตัวผู้ช่วยเหลืออย่างแรงหลาย ๆ ครั้ง จนพูดออกมาได้
INSERT INTO `subject` VALUES (4,'วิธีปฐมพยาบาล','1. ป้องกันการบาดเจ็บจากการล้ม
INSERT INTO `subject` VALUES (5,'ข้อควรระวัง','1. ไม่นำของแข็งใส่เข้าไปในปาก เพื่องัดฟัน
