INSERT INTO `subject` VALUES (9,'ข้อควรระวัง','1. ท่านั่งเงยหน้าจะทำให้เลือดไหลลงคอ และทำให้อาเจียนได้
INSERT INTO `subject` VALUES (10,'วิธีปฐมพยาบาล','1. ล้างตาด้วยน้ำสะอาด นานประมาณ 20 นาที โดยใช้ วิธีเปิดน้ำจากก๊อกเบาๆ ล้างหรือเทน้ำจากแก้วล้าง ระวังอย่าให้น้ำ กระเด็นเข้าตาอีกข้างหนึ่ง
INSERT INTO `subject` VALUES (11,'วิธีปฐมพยาบาล','1. บีบจมูกข้างที่ไม่มีของ แล้วสั่งออกมาแรงๆ
INSERT INTO `subject` VALUES (12,'วิธีปฐมพยาบาล','1. เปิดสิ่งปกปิดให้เห็นบริเวณแผลที่เลือดออก
INSERT INTO `subject` VALUES (13,'วิธีปฐมพยาบาล','1. ให้ผู้ป่วยเจ็บนอนราบ ชันเข่า เพื่อให้หน้าท้องหย่อน
INSERT INTO `subject` VALUES (14,'ข้อควรระวัง','1. ห้ามให้อาหาร ยา และน้ำทางปาก
INSERT INTO `subject` VALUES (15,'วิธีปฐมพยาบาล','1. ถ้ามีแผลเปิดที่บริเวณผนังทรวงอกให้ใช้พลาสติกขนาดใหญ่กว่าแผลเล็กน้อยปิดแผลและใช้พลาสเตอร์ปิดไว้ 3 ด้าน อีกด้านหนึ่งปล่อยไว้ให้ลมออกจากแผล เพื่อป้องกันลมคั่งในทรวงอก
INSERT INTO `subject` VALUES (16,'ข้อควรระวัง','ห้ามให้อาหาร ยา และน้ำทางปาก',10);
INSERT INTO `subject` VALUES (17,'วิธีปฐมพยาบาล','1. ใช้ผ้าสะอาดวางรอบ ๆ วัตถุนั้น แล้วพันผ้ารอบ ๆ วัตถุให้แน่นเพื่อไม่ให้วัตถุขยับ
INSERT INTO `subject` VALUES (18,'ข้อควรระวัง','1. ห้ามดึงวัตถุนั้นออกจากแผล เพราะอาจจะทำให้เกิดอันตรายต่ออวัยวะข้างเคียง หรือทำให้เลือดออกมากขึ้น
INSERT INTO `subject` VALUES (19,'วิธีปฐมพยาบาล','1. ควรรีบให้การช่วยเหลือทันที ถ้ามีเลือดออกมาภายนอก ต้องห้ามเลือดโดยใช้วิธีกดลงบนบาดแผลโดยตรง หรือกดเส้นเลือดแดงบริเวณบาดแผล ถ้ามีกระดูกหักร่วมด้วยจะต้องดามกระดูกส่วนที่หักให้อยู่นิ่งๆ นอกจากนี้อาการช็อกจะเกิดขึ้นได้เสมอ เนื่องจากมีเลือดออกภายในซึ่งจะต้องดูแลอย่างใกล้ชิด
INSERT INTO `subject` VALUES (20,'วิธีปฐมพยาบาล','1. ห้ามเลือดส่วนที่ถูกตัดขาด โดยใช้ผ้าสะอาดกดลงบริเวณบาดแผล และพันทับด้วยผ้าให้แน่นพอควร ยกส่วนนั้นให้สูงขึ้น
INSERT INTO `subject` VALUES (21,'ข้อควรระวัง','1. ไม่ควรห้ามเลือดโดยใช้การขันชะเนาะ หรือเครื่องมือห้ามเลือด
INSERT INTO `subject` VALUES (22,'วิธีปฐมพยาบาล','1. รีบนำส่งโรงพยาบาล
INSERT INTO `subject` VALUES (23,'วิธีปฐมพยาบาล','1. งดการใช้ข้อหรืออวัยวะนั้น เพื่อให้ข้อที่บาดเจ็บอยู่นิ่ง ๆ หรือเคลื่อนไหวน้อยที่สุด และจัดให้อยู่ในท่าที่สบาย โดยใช้ผ้ายืดพันรอบข้อนั้นให้แน่นพอควร
INSERT INTO `subject` VALUES (24,'วิธีปฐมพยาบาล','1. ให้พักข้ออยู่นิ่ง ๆ อย่าพยายามดึงข้อที่เคลื่อนให้เข้าที่
INSERT INTO `subject` VALUES (25,'วิธีปฐมพยาบาล','1. ให้อวัยวะส่วนที่บาดเจ็บอยู่นิ่ง ๆ และหยุดการเคลื่อนไหว
INSERT INTO `subject` VALUES (26,'ข้อควรระวัง','1. ห้ามดึง หรือพยายามจัดส่วนของกระดูกที่หักให้เข้าที่
INSERT INTO `subject` VALUES (27,'วิธีปฐมพยาบาล','1. วัสดุที่ใช้ดามต้องยาวกว่าอวัยวะส่วนที่หัก
INSERT INTO `subject` VALUES (28,'วิธีปฐมพยาบาล','1. งดอาหารรสจัด และย่อยยาก เลือกกินอาหารเหลว กินจนกว่าอาการจะดีขึ้น
INSERT INTO `subject` VALUES (29,'วิธีปฐมพยาบาล','1. ยืดกล้ามเนื้อที่เกร็งให้คลายตัว
INSERT INTO `subject` VALUES (30,'วิธีปฐมพยาบาล','1. ใช้น้ำสะอาดราดหรือแช่บริเวณแผล เป็นเวลาอย่างน้อย 10 นาที
INSERT INTO `subject` VALUES (31,'ข้อควรระวัง','1. ผู้ป่วยเจ็บที่โดนไฟคลอก โดนความร้อนบริเวณใบหน้า อาจมีปัญหาทางเดินหายใจร่วมด้วย
INSERT INTO `subject` VALUES (32,'วิธีปฐมพยาบาล','1. กำจัดสาเหตุ โดยใช้วัสดุที่เป็นฉนวน เขี่ยไฟฟ้าออก ดึงตัวผู้บาดเจ็บออกจากสายไฟฟ้า ปิดสวิทช์ไฟ หรือสับสะพานไฟ
INSERT INTO `subject` VALUES (33,'วิธีปฐมพยาบาล','1. ใช้น้ำสะอาดไหลผ่านบริเวณแผลมาก ๆ อย่างน้อย ๑๐ นาที หรือจนกว่าอาการปวดแสบปวดร้อนจะลดลง
INSERT INTO `subject` VALUES (34,'ข้อควรระวัง','1. งดจับต้องแผลโดยไม่จำเป็น
INSERT INTO `subject` VALUES (35,'วิธีปฐมพยาบาล','1. กดปิดแผลรอยเขี้ยวด้วยผ้าสะอาด
INSERT INTO `subject` VALUES (36,'ข้อควรระวัง','1. ห้ามใช้มีดกรีด ไฟจี้ พอกแผล หรือปากดูดบริเวณแผล
INSERT INTO `subject` VALUES (37,'วิธีปฐมพยาบาล','1. การขจัดพิษออกจากร่างกาย หากพบว่ายังมีสารพิษตกค้างตามเสื้อผ้า ร่างกาย ต้องรีบถอดออกและล้างทำความสะอาดทันที
INSERT INTO `subject` VALUES (38,'วิธีปฐมพยาบาล','1. พิษจากยาปราบวัชพืช ยาฆ่าหญ้า เป็นสารที่มีพิษรุนแรง อันตรายมาก ดูดซึมเข้าสู่ร่างกายทางผิวหนัง สูดดมเข้าไปในขณะฉีดพ่น
INSERT INTO `subject` VALUES (39,'วิธีปฐมพยาบาล','1. ให้การปฐมพยาบาลโดยดูแลระบบทางเดินหายใจให้โล่ง และช่วยหายใจในกรณีที่หายใจไม่เพียงพอ 
INSERT INTO `subject` VALUES (40,'วิธีปฐมพยาบาล','1. ประเมินว่าผู้ป่วยเจ็บกินสารพิษเข้าไปหรือไม่
INSERT INTO `subject` VALUES (41,'ข้อควรระวัง','ห้ามทำให้อาเจียนในผู้ป่วยเจ็บต่อไปนี้
INSERT INTO `subject` VALUES (42,'วิธีปฐมพยาบาล','1. จัดให้นอนหงายราบไม่หนุนหมอน ตะแคงหน้า เพื่อป้องกันการสำลักน้ำลายหรืออาเจียน ยกปลายเท้าให้สูงประมาณ 1 ฟุต
INSERT INTO `subject` VALUES (43,'วิธีปฐมพยาบาล','1. อย่าตกใจ ห้ามคนมุง หรือเข้าไปรบกวนขณะชัก
INSERT INTO `subject` VALUES (44,'วิธีปฐมพยาบาล','1. ทายาแก้ผดผื่นคันคาลาไมน์ ในเด็กใช้ซาเมธาโซนครีม
INSERT INTO `subject` VALUES (45,'การช่วยฟื้นคืนชีพขั้นพื้นฐาน','				การช่วยฟื้นคืนชีพขั้นพื้นฐาน หมายถึง การช่วยชีวิตคนหัวใจหยุดเต้น หรือคนที่หยุดหายใจกระทันหันจากระบบไหลเวียนเลือดและระบบหายใจล้มเหลว
INSERT INTO `subject` VALUES (46,'วิธีปฐมพยาบาล','1. ตรวจดูว่าผู้ป่วยรู้สึกตัวหรือไม่ โดยการใช้มือทั้ง 2 ข้างจับบริเวณไหล่ เขย่าให้แรงพอสมควรพร้อมเรียกผู้ป่วยดังๆ
INSERT INTO `subject` VALUES (47,'การช่วยการหายใจ','				ถ้าผู้ป่วยเป็นญาติสนิทและมั่นใจว่าไม่เป็นโรคติดต่อใดๆ ทำการช่วยหายใจโดยการเป่าปาก ผู้ป่วย 2 ครั้ง โดยวางปากผู้ช่วยเหลือครอบปากผู้ป่วยให้แนบสนิท บีบจมูกผู้ป่วยให้แนบสนิทและเป่าลมเข้าไป โดยการเป่าแต่ละครั้งให้ยาว ประมาณ 1-2 วินาที จนเห็นหน้าอกผู้ป่วยยกตัวขึ้นพร้อมกับปล่อยให้หน้าอกผู้ป่วย ยุบลงมาอยู่ตำแหน่งเดิมก่อนที่จะเป่าครั้งที่ 2',33);
INSERT INTO `subject` VALUES (48,'วิธีปฐมพยาบาล','1. ล้างแผลด้วยน้ำสะอาดและสบู่จนหมดสิ่งสกปรก
INSERT INTO `subject` VALUES (49,'วิธีปฐมพยาบาล','1. ประคบด้วยความเย็น เช่น ผ้าห่อถุงน้ำแข็งผสมน้ำ ภายใน 24 ชั่วโมงแรกเพื่อห้ามเลือด
INSERT INTO `subject` VALUES (50,'วิธีปฐมพยาบาล','1. ล้างแผลให้สะอาดด้วยน้ำ และสบู่ 10-15 นาที โดยล้างให้ถึงก้นแผล
INSERT INTO `subject` VALUES (51,'วิธีปฐมพยาบาล','1. เคลื่อนย้ายผู้ป่วยเจ็บไปสู่บริเวณที่ปลอดภัย เพื่อป้องกันการโดนต่อยซ้ำ
INSERT INTO `subject` VALUES (52,'วิธีปฐมพยาบาล','1. จัดให้นอนตะแคงกึ่งคว่ำ รีบตรวจสอบการหายใจ
INSERT INTO `subject` VALUES (53,'กรณีมีผู้ช่วยเหลือ 1 คน','1. ท่าประคองเดิน ใช้สำหรับผู้ป่วยเจ็บรู้สึกตัวดี และพอจะช่วยตัวเองได้ ไม่มีกระดูกหรือกระดูกสันหลังหัก และผู้ป่วยตัวใหญ่พอ ๆ กับผู้ช่วยเหลือ
